public class InnerCisScanConfigurationScheduleFactory(Action<Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule> factoryAction = null) : SubResourceFactory<Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule>
{

    internal InnerCisScanConfigurationDailyScheduleFactory DailyFactory { get; set; }

    internal InnerCisScanConfigurationMonthlyScheduleFactory MonthlyFactory { get; set; }

    internal InnerCisScanConfigurationWeeklyScheduleFactory WeeklyFactory { get; set; }

    protected override Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule Create()
    {
        var scheduleResult = CreateSchedule();
        factoryAction?.Invoke(scheduleResult);

        return scheduleResult;
    }

    private Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule CreateSchedule()
    {
        var scheduleResult = new Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule();

        return scheduleResult;
    }
    public override void CreateChildren(Humidifier.InspectorV2.CisScanConfigurationTypes.Schedule result)
    {
        base.CreateChildren(result);

        result.Daily ??= DailyFactory?.Build();
        result.Monthly ??= MonthlyFactory?.Build();
        result.Weekly ??= WeeklyFactory?.Build();
    }

} // End Of Class

